import { mapState } from 'vuex';
export default {
  name: 'showModal',
  props: {
    id: {
      type: String,
      default: ''
    },
    modal: {
      type: Boolean,
      default: false
    },
    title: {
      type: String,
      default: '日志查看'
    },
    okText: {
      type: String,
      default: '确定'
    }
  },
  computed: mapState(['logStore']),
  data: function data() {
    return {
      showModal: false,
      showLoading: false,
      showForm: {
        id: '',
        tableName: '',
        recordId: '',
        fieldName: '',
        logTypeVal: 0,
        logTypeCode: '',
        optTypeVal: 0,
        optTypeCode: '',
        optDesc: '',
        beforeValue: '',
        afterValue: '',
        remark: '',
        createAt: 0,
        createBy: '',
        createName: '',
        updateAt: 0,
        updateBy: '',
        updateName: '',
        isDel: 0,
        isTest: 0
      }
    };
  },
  watch: {
    modal: function modal(val) {
      if (val && this.id !== '') {
        this.showForm.id = this.id;
        this.showModal = val;
        this.showLog();
      }
    },
    showModal: function showModal(val) {
      if (!val) {
        this.$emit('on-modal-change', '', val);
      }
    }
  },
  methods: {
    showLog: function showLog() {
      var _this = this;
      this.$store.dispatch('showLog', {
        params: {
          id: this.showForm.id
        }
      }).then(function () {
        _this.showForm = _this.logStore.item;
      });
    },
    handleOk: function handleOk() {
      this.handleCancel();
    },
    handleCancel: function handleCancel() {
      this.resetFields();
      this.showModal = false;
      this.showLoading = false;
    },
    resetFields: function resetFields() {
      this.$refs.showForm.resetFields();
    }
  }
};
